[General]
image-path=../../images
output-scalar-file-append = false
sim-time-limit=1000s
network = SingleCell
**.routingRecorder.enabled = false
**.vector-recording = false
*.configurator.config = xmldoc("demo.xml")

################ Mobility parameters #####################
# *
**.mobility.constraintAreaMinZ = 0m
**.mobility.constraintAreaMaxZ = 0m
**.mobility.initFromDisplayString = false

# Configurator settings
*.configurator.dumpAddresses = true
*.configurator.dumpTopology = true
*.configurator.dumpLinks = true
*.configurator.dumpRoutes = true
**.ipv4.arp.typename = "GlobalArp"
*.*.ipv4.routingTable.netmaskRoutes = ""


*.numUe = 215

# UDPBasicApp
*.C[*].numApps = 2
*.C[*].app[0].typename = "UdpBasicBroadFL"
#*.C[*].app[0].startTime = uniform(0.1s, 0.5s)
*.C[*].app[0].destAddresses = "224.0.0.1"
*.C[*].app[0].messageLength = 300B
*.C[*].app[0].sendInterval = 2s #1s

*.C[*].app[0].destPort = 3000

*.C[*].app[1].typename = "UdpSinkFL"
*.C[*].app[1].localPort = 3000
**.checkInterval = 3

# Ieee80211Interface
*.C[*].wlan[0].opMode = "p"
*.C[*].wlan[0].radio.typename = "Ieee80211DimensionalRadio"
*.C[*].wlan[0].radio.bandName = "5.9 GHz"
*.C[*].wlan[0].radio.channelNumber = 3
*.C[*].wlan[0].radio.transmitter.power = 100mW
*.C[*].wlan[0].radio.bandwidth = 10 MHz
*.C[*].wlan[*].radio.antenna.mobility.typename = "AttachedMobility"
*.C[*].wlan[*].radio.antenna.mobility.mobilityModule = "^.^.^.^.mobility"
*.C[*].wlan[*].radio.antenna.mobility.offsetX = -2.5m
*.C[*].wlan[*].radio.antenna.mobility.offsetZ = 1.5m
*.C[*].wlan[*].radio.antenna.mobility.constraintAreaMinX = 0m
*.C[*].wlan[*].radio.antenna.mobility.constraintAreaMaxX = 0m
*.C[*].wlan[*].radio.antenna.mobility.constraintAreaMinY = 0m
*.C[*].wlan[*].radio.antenna.mobility.constraintAreaMaxY = 0m


*.C[*].mobility.typename = "StationaryMobility"

*.C[*].mobility.initialY = 50m

